import React, {useState,useEffect} from 'react';
import List from '@mui/material/List';
import Tooltip from '@mui/material/Tooltip';
import ListItem from '@mui/material/ListItem';
import Divider from '@mui/material/Divider';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import axios from 'axios';
import { Link, useNavigate} from 'react-router-dom';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';

const User = () => {
    const [usersData, setUsersData] = useState([]);

    const userList = () => {
        axios.get("https://jsonplaceholder.typicode.com/users").then((res) => {
            console.log("res", res.data)
            setUsersData(res.data);

        })
    }

    useEffect(()=>{
        userList()
    }, []);

    const navigate = useNavigate();

    const handleUserDetails = (id) => {
        const userData = usersData.find((user)=>user.id===id)   
        navigate("/userProfile/"+userData.id, {state:{userData: {id:userData.id, name:userData.name, email:userData.email, phone:userData.phone, website:userData.website}}});
    }



  return (
    <div>
      <h4>List Of Users</h4>

      <Container maxWidth="md" sx={{ height: '100vh' }} >
        {/* <Box sx={{ bgcolor: '#cfe8fc', height: '100vh' }} /> */}
        {usersData.map((item) => {
    const hoveringText = `Name : ${item.name},\nEmail : ${item.email}`
    return (
        <>

         <List sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper'}}>
        {/* <Link to={"/userProfile/"+item.id} key={item.id}> */}
         <Tooltip title={hoveringText} >
         <ListItem alignItems="flex-center">
         <ListItemAvatar>
          <Avatar alt="" src="" />
        </ListItemAvatar>

        <ListItemText
          onClick={()=>handleUserDetails(item.id)}
          primary={item.name}          
        //   secondary={
        //     <React.Fragment>
        //       <Typography
        //         sx={{ display: 'inline' }}
        //         component="span"
        //         variant="body2"
        //         color="text.primary"
        //       >
        //         {item.name}
        //       </Typography>
        //     </React.Fragment>
        //   }
        />

      </ListItem>
      </Tooltip>
      {/* </Link> */}
      </List>
      <Divider />
        </>

    )
    })}
      </Container>

    </div>
  )
}

export default User
